import Homepage from './component/Homepage';
import Post from './pages/posts/Post';
import Posts from './pages/posts/Pots';
import Account from './pages/users/Account';
import Register from './pages/users/Register';
import Login from './pages/users/Login';
import Profile from './pages/users/Profile';
import Navbar from './component/Navbar';
import Test from './component/Test';
import { Route, Switch, BrowserRouter } from 'react-router-dom';
import { useState } from 'react';
import { hasAuthenticated } from './services/AuthAp';
import Auth from './contexts/Auth';
import AuthenticatedRoute from './component/AuthenticatedRoute';


function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(hasAuthenticated());
  return (
    <>
      <h1>test</h1>
      <Auth.Provider value={{ isAuthenticated }}>
        <BrowserRouter forceRefresh={true}>
          <Navbar />
          <div className="container-fluid">

            <Switch>
              <Route exact path='/login' component={Login} ></Route>
              <Route exact path='/' component={Homepage} > <Homepage /></Route>
              <Route exact path='/posts' component={Posts} ><Posts /></Route>
              <Route exact path='/post/:id' component={Post} ></Route>
              <Route exact path='/account' component={Account} ></Route>
              <Route exact path='/register' component={Register} ></Route>
              <Route exact path='/profile' component={Profile} ></Route>
              <Route exact path='/Test' component={Test} ></Route>
              <AuthenticatedRoute path='/profile' component={Profile}></AuthenticatedRoute>
            </Switch>
          </div>
        </BrowserRouter>
      </Auth.Provider>
    </>
  );
}

export default App;
